type IBtnProps = {
    border: string;
    color: string;
    children: React.ReactNode;
    height: string;
    width: string;
    onClick?: () => void;
    radius: string
};

const Primary = (props: IBtnProps) => {
    return (
        <button
            style={{
                border: '3px solid black',
                color: 'pink',
                height: '40px',
                width: '100px',
                borderRadius: '30%',
            }}
        >{props.children}</button>
    );
};

